import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './Home';  

import './App.css';
import itemDetails from './pages/itemDetails';

const App = () => (
  <Switch>
    <Route exact={true} path="/" component={Home} />
    <Route exact={true} path="/women" component={Home} />
    <Route exact={true} path="/men" component={Home} />
    <Route exact={true} path="/kids" component={Home} />
    <Route exact={true} path="/shoes" component={Home} />
    <Route exact={true} path="/brands" component={Home} />
    <Route exact={true} path="/item/:id" component={itemDetails} />

  </Switch>
);

export default App;
